(231, '2022-08-21 09:55:11', '\\App', '1', NULL, NULL, 'Articles', '1', 'info', 'update', '', '{\"description\":\"<p><strong>The UK and New Zealand will allow more younger people to live and work in both countries for longer.<\\/strong><\\/p><p>UK Prime Minister Boris Johnson and his Kiwi counterpart Jacinda Ardern agreed to extend the Youth Mobility and Working Holiday schemes.<\\/p><p>The age limit for applicants will go up from 30 to 35, and the maximum length of time people can stay in the host country will now be three years.<\\/p><p>It follows similar deal to allow young people to <a href=\\\"https:\\/\\/www.bbc.com\\/news\\/business-59690080\\\">work and travel in Australia<\\/a>.<\\/p><p>&nbsp;<\\/p><figure class=\\\"media\\\"><oembed url=\\\"https:\\/\\/www.youtube.com\\/watch?v=KMqi3k0cpy0\\\"><\\/oembed><\\/figure><p>The UK-New Zealand scheme was previously open to 18-30 year olds.<\\/p><p>Home Secretary Priti Patel said the move \\\"will give even more young Brits and New Zealanders the opportunity to develop their skills, make life-long connections and contribute to their host country\\\".<\\/p><figure class=\\\"image\\\"><img src=\\\"https:\\/\\/ichef.bbci.co.uk\\/news\\/640\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg\\\" alt=\\\"Boris Johnson and Jacinda Ardern\\\" srcset=\\\"https:\\/\\/ichef.bbci.co.uk\\/news\\/240\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg.webp 240w, https:\\/\\/ichef.bbci.co.uk\\/news\\/320\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg.webp 320w, https:\\/\\/ichef.bbci.co.uk\\/news\\/480\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg.webp 480w, https:\\/\\/ichef.bbci.co.uk\\/news\\/624\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg.webp 624w, https:\\/\\/ichef.bbci.co.uk\\/news\\/800\\/cpsprodpb\\/11262\\/production\\/_125724207_hi077091937.jpg.webp 800w\\\" sizes=\\\"100vw\\\"><\\/figure><p>IMAGE SOURCE,REUTERS<\\/p><p>Image caption,<\\/p><p>Boris Johnson and Jacinda Ardern met for talks at Downing Street<\\/p><p>Ms Ardern, who is in London for talks with Mr Johnson, said New Zealand had long advocated for improvements to working holiday visas.<\\/p><p>The NZ Labour Party leader previously lived in London when she worked in Whitehall as a senior policy adviser before entering politics.<\\/p><p>\\\"I was one of many Kiwis to enjoy living and working in the UK, and we look forward to offering Brits the same wonderful experience in New Zealand,\\\" she added.<\\/p><p>The prime ministers met at Downing Street following the Nato summit in Madrid which finished on Thursday.<\\/p><p>Ms Ardern said the pair would be discussing the <a href=\\\"https:\\/\\/www.bbc.com\\/news\\/business-58988711\\\">free trade deal signed last year<\\/a> as well as the response to the war in Ukraine<\\/p><p>Mr Johnson praised the \\\"very strong line\\\" New Zealand was taking, and Ms Ardern said: \\\"We have also provided our military aid via our partnership with you,\\\"<\\/p><p>The Home Office said more information on the <a href=\\\"https:\\/\\/www.gov.uk\\/youth-mobility\\\">Youth Mobility and Working Holiday<\\/a> scheme will be announced next year.<\\/p>\"}'),
