(480, '2022-09-25 07:04:55', 'Posts', '1', NULL, NULL, 'Posts', '1', 'info', 'create', '', '{\"title\":\"Peking University\",\"short_description\":\"Founded in 1898 and originally known as the Imperial University of Peking, Peking University (PKU) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University\\u2019s core values are defined as \\u201cFreedom of thought, Embrace of diversity\\u201d\",\"description\":\"Founded in 1898 and originally known as the Imperial University of Peking, Peking University (PKU) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University\\u2019s core values are defined as \\u201cFreedom of thought, Embrace of diversity\\u201d.\\r\\n\\r\\nThroughout its history, Peking University has played an integral role in the advancement of knowledge and the betterment of society. Generations of preeminent scholars, politicians, entrepreneurs, and innovators educated at Peking University have profoundly shaped China\\u2019s modernization and will continue to pioneer the nation\\u2019s developments.\\r\\n\\r\\nPeking University celebrated the 120th anniversary of its founding in 2018. In 2019, Peking University launched its Global Excellence Strategy, characterized by CLOUDS (an acronym for its goals of Creativity, Leadership, Openness, Uniqueness, Diversity and Shaping), which has ushered in a new era of international development for Peking University.\",\"url\":\"https:\\/\\/english.pku.edu.cn\\/\",\"photo\":\"wechat_image_20210422162520.jpg\",\"user_id\":23,\"created\":\"2022-09-25T12:34:55+05:30\",\"photo_dir\":\"82a693b7-c7aa-475e-98f6-e31508b6249f\",\"id\":1}'),
(481, '2022-09-25 07:04:55', '\\App', '1', NULL, NULL, 'Posts', '1', 'info', 'create', '', '{\"title\":\"Peking University\",\"short_description\":\"Founded in 1898 and originally known as the Imperial University of Peking, Peking University (PKU) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University\\u2019s core values are defined as \\u201cFreedom of thought, Embrace of diversity\\u201d\",\"description\":\"Founded in 1898 and originally known as the Imperial University of Peking, Peking University (PKU) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University\\u2019s core values are defined as \\u201cFreedom of thought, Embrace of diversity\\u201d.\\r\\n\\r\\nThroughout its history, Peking University has played an integral role in the advancement of knowledge and the betterment of society. Generations of preeminent scholars, politicians, entrepreneurs, and innovators educated at Peking University have profoundly shaped China\\u2019s modernization and will continue to pioneer the nation\\u2019s developments.\\r\\n\\r\\nPeking University celebrated the 120th anniversary of its founding in 2018. In 2019, Peking University launched its Global Excellence Strategy, characterized by CLOUDS (an acronym for its goals of Creativity, Leadership, Openness, Uniqueness, Diversity and Shaping), which has ushered in a new era of international development for Peking University.\",\"url\":\"https:\\/\\/english.pku.edu.cn\\/\",\"photo\":\"wechat_image_20210422162520.jpg\",\"user_id\":23,\"created\":\"2022-09-25T12:34:55+05:30\",\"photo_dir\":\"82a693b7-c7aa-475e-98f6-e31508b6249f\",\"id\":1}');
