(502, '2022-09-25 07:22:37', 'Helps', '2', NULL, NULL, 'Helps', '2', 'info', 'create', '', '{\"title\":\"I wish to follow AAT. What should I do first?\",\"description\":\"<p>Registering with AAT is the first compulsory step anybody who wishes to follow AAT should do. Only the registered students can apply for AAT examinations \\/ exemptions, receive correspondence from AAT and get eligible for any benefits announced by AAT. Initial registration is valid for one calendar year in which you register (until 30th of December of the given year ) regardless of the date of registration and is required to be renewed annually until you complete all AAT examinations and become a Passed Finalist (PF) . Once you become a PF, you will be awarded with the certificate named \\u201cDiploma in Accounting and Business\\u201d.<\\/p><p>If you have registered for the July Examination, with your initial registration, you will be eligible to apply for both July and next year January examinations.<\\/p><p>You are not required to register annually as this is a one-time process. Renewal of the registration will be required annually.<\\/p>\",\"status\":\"1\",\"created\":\"2022-09-25T12:52:37+05:30\",\"id\":2}'),
(503, '2022-09-25 07:22:37', '\\App', '1', NULL, NULL, 'Helps', '2', 'info', 'create', '', '{\"title\":\"I wish to follow AAT. What should I do first?\",\"description\":\"<p>Registering with AAT is the first compulsory step anybody who wishes to follow AAT should do. Only the registered students can apply for AAT examinations \\/ exemptions, receive correspondence from AAT and get eligible for any benefits announced by AAT. Initial registration is valid for one calendar year in which you register (until 30th of December of the given year ) regardless of the date of registration and is required to be renewed annually until you complete all AAT examinations and become a Passed Finalist (PF) . Once you become a PF, you will be awarded with the certificate named \\u201cDiploma in Accounting and Business\\u201d.<\\/p><p>If you have registered for the July Examination, with your initial registration, you will be eligible to apply for both July and next year January examinations.<\\/p><p>You are not required to register annually as this is a one-time process. Renewal of the registration will be required annually.<\\/p>\",\"status\":\"1\",\"created\":\"2022-09-25T12:52:37+05:30\",\"id\":2}'),
