(506, '2022-09-25 07:41:37', 'Helps', '3', NULL, NULL, 'Helps', '3', 'info', 'create', '', '{\"title\":\"How to choose the best country for immigration\",\"description\":\"<p>The migration policy of many countries does not allow foreigners to obtain permanent residence without a temporary one. The exception is a few states that offer to get permanent residency by investment and skip the stage of temporary residence.&nbsp;<\\/p><p>The article discusses opportunities for immigration in different countries, and where it is cheaper to live and easier to settle.<\\/p>\",\"status\":\"1\",\"created\":\"2022-09-25T13:11:37+05:30\",\"id\":3}'),
(507, '2022-09-25 07:41:37', '\\App', '1', NULL, NULL, 'Helps', '3', 'info', 'create', '', '{\"title\":\"How to choose the best country for immigration\",\"description\":\"<p>The migration policy of many countries does not allow foreigners to obtain permanent residence without a temporary one. The exception is a few states that offer to get permanent residency by investment and skip the stage of temporary residence.&nbsp;<\\/p><p>The article discusses opportunities for immigration in different countries, and where it is cheaper to live and easier to settle.<\\/p>\",\"status\":\"1\",\"created\":\"2022-09-25T13:11:37+05:30\",\"id\":3}'),
