(512, '2022-09-25 08:04:19', 'Posts', '2', NULL, NULL, 'Posts', '2', 'info', 'create', '', '{\"title\":\"University of Oxford\",\"short_description\":\"The University of Oxford is the oldest university in the English-speaking world and the world\\u2019s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.\",\"description\":\"The University of Oxford is the oldest university in the English-speaking world and the world\\u2019s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.\\r\\n\\r\\nLocated in and around Oxford\\u2019s medieval city centre, the university comprises 44 colleges and halls, and over 100 libraries, making it the largest library system in the UK.\\r\\n\\r\\nStudents number around 22,000 in total, just over half of whom are undergraduates while over 40 per cent are international, representing 140 countries between them.\\r\\n\\r\\nCalled the \\\"city of dreaming spires\\\" by Victorian poet, Matthew Arnold, Oxford has the youngest population of any city in England and Wales: nearly a quarter of its residents are university students, which gives Oxford a noticeable buzz.\\r\\n\\r\\nOxford has an alumni network of over 250,000 individuals, including more than 120 Olympic medallists, 26 Nobel Prize winners, seven poets laureate, and over 30 modern world leaders (Bill Clinton, Aung San Suu Kyi, Indira Gandhi and 26 UK Prime Ministers, among them).\\r\\n\\r\\nThe university is associated with 11 winners of the Nobel Prize in chemistry, five in physics and 16 in medicine. Notable Oxford thinkers and scientists include Tim Berners-Lee, Stephen Hawking and Richard Dawkins. The actors Hugh Grant and Rosamund Pike also went to Oxford, as did the writers Oscar Wilde, Graham Greene, Vikram Seth and Philip Pullman.\\r\\n\\r\\nOxford\\u2019s first international student, named Emo of Friesland, was enrolled in 1190, while the modern day university prides itself on having an \\u2018international character\\u2019 with connections to almost every country in the world and 40% of its faculty drawn from overseas.\\r\\n\\r\\nAs a modern, research-driven university, Oxford has numerous strengths but cites particular prowess in the sciences, having recently ranked number one in the world for medicine (if its medical sciences division was a university in its own right, it would be the fourth largest in the UK) and among the top ten universities globally for life sciences, physical sciences, social sciences, and the arts and humanities.\",\"url\":\"https:\\/\\/www.ox.ac.uk\\/\",\"photo\":\"view-University-of-Oxford-England-Oxfordshire.webp\",\"user_id\":23,\"created\":\"2022-09-25T13:34:19+05:30\",\"photo_dir\":\"c7bdbc7c-3f14-48dc-89af-8d51b0eda9de\",\"id\":2}'),
(513, '2022-09-25 08:04:19', '\\App', '1', NULL, NULL, 'Posts', '2', 'info', 'create', '', '{\"title\":\"University of Oxford\",\"short_description\":\"The University of Oxford is the oldest university in the English-speaking world and the world\\u2019s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.\",\"description\":\"The University of Oxford is the oldest university in the English-speaking world and the world\\u2019s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.\\r\\n\\r\\nLocated in and around Oxford\\u2019s medieval city centre, the university comprises 44 colleges and halls, and over 100 libraries, making it the largest library system in the UK.\\r\\n\\r\\nStudents number around 22,000 in total, just over half of whom are undergraduates while over 40 per cent are international, representing 140 countries between them.\\r\\n\\r\\nCalled the \\\"city of dreaming spires\\\" by Victorian poet, Matthew Arnold, Oxford has the youngest population of any city in England and Wales: nearly a quarter of its residents are university students, which gives Oxford a noticeable buzz.\\r\\n\\r\\nOxford has an alumni network of over 250,000 individuals, including more than 120 Olympic medallists, 26 Nobel Prize winners, seven poets laureate, and over 30 modern world leaders (Bill Clinton, Aung San Suu Kyi, Indira Gandhi and 26 UK Prime Ministers, among them).\\r\\n\\r\\nThe university is associated with 11 winners of the Nobel Prize in chemistry, five in physics and 16 in medicine. Notable Oxford thinkers and scientists include Tim Berners-Lee, Stephen Hawking and Richard Dawkins. The actors Hugh Grant and Rosamund Pike also went to Oxford, as did the writers Oscar Wilde, Graham Greene, Vikram Seth and Philip Pullman.\\r\\n\\r\\nOxford\\u2019s first international student, named Emo of Friesland, was enrolled in 1190, while the modern day university prides itself on having an \\u2018international character\\u2019 with connections to almost every country in the world and 40% of its faculty drawn from overseas.\\r\\n\\r\\nAs a modern, research-driven university, Oxford has numerous strengths but cites particular prowess in the sciences, having recently ranked number one in the world for medicine (if its medical sciences division was a university in its own right, it would be the fourth largest in the UK) and among the top ten universities globally for life sciences, physical sciences, social sciences, and the arts and humanities.\",\"url\":\"https:\\/\\/www.ox.ac.uk\\/\",\"photo\":\"view-University-of-Oxford-England-Oxfordshire.webp\",\"user_id\":23,\"created\":\"2022-09-25T13:34:19+05:30\",\"photo_dir\":\"c7bdbc7c-3f14-48dc-89af-8d51b0eda9de\",\"id\":2}'),
