(710, '2022-12-04 16:24:51', 'Posts', '4', NULL, NULL, 'Posts', '4', 'info', 'create', '', '{\"title\":\"Zenith Immigration Lawyers\",\"short_description\":\"n an era where there were no properly recognized professionals with relevant qualifications and experience to cater to the needs in the immigration legal field, Zenith Immigration Lawyers was founded and presided by Bandula Abeysinghe, Attorney at Law in the year 2000.\",\"description\":\"In an era where there were no properly recognized professionals with relevant qualifications and experience to cater to the needs in the immigration legal field, Zenith Immigration Lawyers was founded and presided by Bandula Abeysinghe, Attorney at Law in the year 2000. In forming the first ever specialized and dedicated law firm for Canada Migration in Sri Lanka, he not only filled a professional vacuum but also used his extensive law courts experience (where he once held the position of the Secretary of the Bar Association, Marawila) to take the firm to greater heights. Today Zenith Immigration stands out and stands tall in the field of immigration legal services in Sri Lanka through the results brought about to the clients which have greatly contributed toward creating a global Sri Lankan identity. With Zenith Immigration Inc., Ontario, Canada and the Glenrock, the top rated boutique hotel in upstream Belihuloya, Sri Lanka( 9.5 out of 10 booking.com and 5 out of 5 tripadvisor rated \\u2013 www.glenrock.lk), Zenith Immigration Lawyers has formed Vebhara Group with a view to a greater future. Canada Migration Services are provided at Zenith Immigration by Bandula Abeysinghe, Attorney at Law (Sri Lanka), in the capacity of Regulated Canadian Immigration Consultant (ICCRC Membership No. R406319)\",\"url\":\"https:\\/\\/www.zenithimmigration.ca\\/\",\"photo\":\"download.jfif\",\"user_id\":40,\"created\":\"2022-12-04T21:54:51+05:30\",\"photo_dir\":\"0a8cbca7-d767-491c-af8d-094d8778dc1a\",\"id\":4}'),
