(730, '2022-12-04 16:41:25', 'Posts', '5', NULL, NULL, 'Posts', '5', 'info', 'create', '', '{\"title\":\"IELTS Exam Offer\",\"short_description\":\"IELTS is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where IELTS is recognised for university applications.\",\"description\":\"IELTS is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where IELTS is recognised for university applications. The exam primarily assesses the test-taker\\u2019s ability to communicate in the four core English language abilities of hearing, reading, speaking, and writing. IDP Education Australia and Cambridge English Language Assessment jointly own and administer the IELTS exam test.\\r\\n\\r\\nThe IELTS exam can be taken on a computer or on paper. Those who take the IELTS computer-based test do so for the Listening, Writing, and Reading portions. The Speaking test, on the other hand, is done in front of a qualified examiner.\\r\\nWith the computer-based IELTS, there are more test dates to select from, and results are available in 3-5 days.\\r\\nThose who want to take the IELTS on paper will complete the Reading, Writing, and Listening parts on paper with HB pencils or pens.\\r\\nThe Speaking test, on the other hand, is done in front of a trained IELTS examiner\",\"url\":\"https:\\/\\/www.aeccglobal.lk\\/english-proficiency-test\\/ielts-exam\",\"photo\":\"123.PNG\",\"user_id\":41,\"created\":\"2022-12-04T22:11:25+05:30\",\"photo_dir\":\"6a8107ea-a255-44be-afab-5af8120e517b\",\"id\":5}'),
(731, '2022-12-04 16:41:25', '\\App', '1', NULL, NULL, 'Posts', '5', 'info', 'create', '', '{\"title\":\"IELTS Exam Offer\",\"short_description\":\"IELTS is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where IELTS is recognised for university applications.\",\"description\":\"IELTS is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where IELTS is recognised for university applications. The exam primarily assesses the test-taker\\u2019s ability to communicate in the four core English language abilities of hearing, reading, speaking, and writing. IDP Education Australia and Cambridge English Language Assessment jointly own and administer the IELTS exam test.\\r\\n\\r\\nThe IELTS exam can be taken on a computer or on paper. Those who take the IELTS computer-based test do so for the Listening, Writing, and Reading portions. The Speaking test, on the other hand, is done in front of a qualified examiner.\\r\\nWith the computer-based IELTS, there are more test dates to select from, and results are available in 3-5 days.\\r\\nThose who want to take the IELTS on paper will complete the Reading, Writing, and Listening parts on paper with HB pencils or pens.\\r\\nThe Speaking test, on the other hand, is done in front of a trained IELTS examiner\",\"url\":\"https:\\/\\/www.aeccglobal.lk\\/english-proficiency-test\\/ielts-exam\",\"photo\":\"123.PNG\",\"user_id\":41,\"created\":\"2022-12-04T22:11:25+05:30\",\"photo_dir\":\"6a8107ea-a255-44be-afab-5af8120e517b\",\"id\":5}'),
