(916, '2023-01-21 16:20:26', 'Articles', '14', NULL, NULL, 'Articles', '14', 'info', 'create', '', '{\"title\":\"Changes to partner work visas deferred to April 2023\",\"short_description\":\"The Minister of Immigration announced today that planned changes for the visa requirements of partners of temporary work visa holders have been deferred to April 2023.\",\"description\":\"<p>These changes were initially set to come into effect in December 2022.<\\/p><p>The Government recognises that there is a need to ensure partners are only entering higher skilled jobs. However, they want to provide certainty for migrant partners of their ability to work in New Zealand and a streamlined process for entering high skilled roles.<\\/p><p>The Government will be looking at some adjustments to the way partner work rights will be implemented to reflect some of the feedback received from stakeholders.<\\/p><p>More information on this will be announced in the New Year.<\\/p><p>More information is available on the Beehive website.<\\/p><p><a href=\\\"https:\\/\\/www.beehive.govt.nz\\/release\\/changes-partner-work-visas-deferred-april-2023\\\">Changes to partner work visas deferred to April 2023 \\u2014 Beehive<\\/a><\\/p>\",\"status\":\"1\",\"photo\":\"Screenshot 2023-01-21 214932.png\",\"user_id\":1,\"created\":\"2023-01-21T21:50:26+05:30\",\"photo_dir\":\"5156e837-a2b0-4e3c-9d90-eb6672aa3f3d\",\"id\":14}'),
(917, '2023-01-21 16:20:26', '\\App', '1', NULL, NULL, 'Articles', '14', 'info', 'create', '', '{\"title\":\"Changes to partner work visas deferred to April 2023\",\"short_description\":\"The Minister of Immigration announced today that planned changes for the visa requirements of partners of temporary work visa holders have been deferred to April 2023.\",\"description\":\"<p>These changes were initially set to come into effect in December 2022.<\\/p><p>The Government recognises that there is a need to ensure partners are only entering higher skilled jobs. However, they want to provide certainty for migrant partners of their ability to work in New Zealand and a streamlined process for entering high skilled roles.<\\/p><p>The Government will be looking at some adjustments to the way partner work rights will be implemented to reflect some of the feedback received from stakeholders.<\\/p><p>More information on this will be announced in the New Year.<\\/p><p>More information is available on the Beehive website.<\\/p><p><a href=\\\"https:\\/\\/www.beehive.govt.nz\\/release\\/changes-partner-work-visas-deferred-april-2023\\\">Changes to partner work visas deferred to April 2023 \\u2014 Beehive<\\/a><\\/p>\",\"status\":\"1\",\"photo\":\"Screenshot 2023-01-21 214932.png\",\"user_id\":1,\"created\":\"2023-01-21T21:50:26+05:30\",\"photo_dir\":\"5156e837-a2b0-4e3c-9d90-eb6672aa3f3d\",\"id\":14}'),
(918, '2023-01-21 16:30:12', 'Articles', '15', NULL, NULL, 'Articles', '15', 'info', 'create', '', '{\"title\":\"Pacific Access Category and Samoan Quota draw to take place on Wednesday 7 December 2022\",\"short_description\":\"The draw to see who will be invited to apply for New Zealand residence under the Pacific Access Category (PAC) and the Samoan Quota (SQ) is happening on Wednesday 7 December.\",\"description\":\"<p>Following the ballots closing for the Pacific Access Category (PAC) and the Samoan Quota (SQ), Immigration New Zealand (INZ) will draw the names of successful applicants on Wednesday 7 December who will be invited to apply for residence under these categories.<\\/p><p>When the categories reopened, the Government agreed to allocate the unused places from the 2020 and 2021 ballots. For the Pacific Access Category, they will be re-allocated across the 2022 and 2023. The unused ballots under the Samoan Quota will be distributed across four years from 2022-2025.<\\/p><p>This means that 1,300 individuals will be invited to apply for residence under the PAC for the 2022 ballot, and 1,650 individuals will be invited to apply for residence under the SQ for the 2022 ballot.<\\/p><p>Successful registrant reference numbers will be published on the INZ website by 12 December, and then formally sent their invitation to apply letter later this month.<\\/p><p>More information:<\\/p><p><a href=\\\"https:\\/\\/www.immigration.govt.nz\\/new-zealand-visas\\/apply-for-a-visa\\/about-visa\\/samoan-quota-scheme-resident-visa\\\">Samoan Quota<\\/a><\\/p><p><a href=\\\"https:\\/\\/www.immigration.govt.nz\\/new-zealand-visas\\/apply-for-a-visa\\/visa-factsheet\\/pacific-access-category-resident-visa\\\">Pacific Access Category<\\/a><\\/p>\",\"status\":\"1\",\"photo\":\"4OEBY6G_image_crop_33075.jpg\",\"user_id\":1,\"created\":\"2023-01-21T22:00:12+05:30\",\"photo_dir\":\"49301480-5ae2-482b-aad0-33d2f11f16be\",\"id\":15}'),
(919, '2023-01-21 16:30:12', '\\App', '1', NULL, NULL, 'Articles', '15', 'info', 'create', '', '{\"title\":\"Pacific Access Category and Samoan Quota draw to take place on Wednesday 7 December 2022\",\"short_description\":\"The draw to see who will be invited to apply for New Zealand residence under the Pacific Access Category (PAC) and the Samoan Quota (SQ) is happening on Wednesday 7 December.\",\"description\":\"<p>Following the ballots closing for the Pacific Access Category (PAC) and the Samoan Quota (SQ), Immigration New Zealand (INZ) will draw the names of successful applicants on Wednesday 7 December who will be invited to apply for residence under these categories.<\\/p><p>When the categories reopened, the Government agreed to allocate the unused places from the 2020 and 2021 ballots. For the Pacific Access Category, they will be re-allocated across the 2022 and 2023. The unused ballots under the Samoan Quota will be distributed across four years from 2022-2025.<\\/p><p>This means that 1,300 individuals will be invited to apply for residence under the PAC for the 2022 ballot, and 1,650 individuals will be invited to apply for residence under the SQ for the 2022 ballot.<\\/p><p>Successful registrant reference numbers will be published on the INZ website by 12 December, and then formally sent their invitation to apply letter later this month.<\\/p><p>More information:<\\/p><p><a href=\\\"https:\\/\\/www.immigration.govt.nz\\/new-zealand-visas\\/apply-for-a-visa\\/about-visa\\/samoan-quota-scheme-resident-visa\\\">Samoan Quota<\\/a><\\/p><p><a href=\\\"https:\\/\\/www.immigration.govt.nz\\/new-zealand-visas\\/apply-for-a-visa\\/visa-factsheet\\/pacific-access-category-resident-visa\\\">Pacific Access Category<\\/a><\\/p>\",\"status\":\"1\",\"photo\":\"4OEBY6G_image_crop_33075.jpg\",\"user_id\":1,\"created\":\"2023-01-21T22:00:12+05:30\",\"photo_dir\":\"49301480-5ae2-482b-aad0-33d2f11f16be\",\"id\":15}'),
(920, '2023-01-21 16:35:25', 'Articles', '16', NULL, NULL, 'Articles', '16', 'info', 'create', '', '{\"title\":\"Boundless Immigration News Weekly Recap: January 19, 2023\",\"short_description\":\"Undocumented workers will now be able to report labor violations without jeopardizing their immigration status. The Biden administration announced a new process that will allow immigrants who are exploited in the workplace, or who witness labor abuses, to apply for protections from deportation and retaliation from their employer.\",\"description\":\"<p><strong>New Policy Protects Exploited Immigrant Workers from Deportation<\\/strong><\\/p><p>Undocumented workers will now be able to report labor violations without jeopardizing their immigration status. The Biden administration<a href=\\\"https:\\/\\/www.cbsnews.com\\/news\\/biden-administration-creates-deportation-protection-process-exploited-migrant-workers\\/\\\"> announced<\\/a> a new process that will allow immigrants who are exploited in the workplace, or who witness labor abuses, to apply for protections from deportation and retaliation from their employer.<\\/p><p>To qualify for deferred action, immigrant workers must submit a written request to USCIS and include a letter from an employment or labor agency supporting the request.<\\/p><p><strong>First Group of Migrants Arrive in U.S. Under New Biden Program<\\/strong><\\/p><p>The first group of migrants has arrived in the U.S. <a href=\\\"https:\\/\\/www.boundless.com\\/blog\\/biden-announce-legal-status-migrants-title-42-expansion\\/?utm_source=autopilot&amp;utm_medium=email&amp;utm_campaign=012023_weekly\\\">under a new program<\\/a> announced earlier this month by the Biden administration to address the crisis at the southern border.<\\/p><p>According to <a href=\\\"https:\\/\\/www.cbsnews.com\\/news\\/migrants-us-sponsorship-program-biden-administration\\/\\\">CBS News<\\/a>, ten migrants have entered the United States as part of the program, which will allow up to 30,000 people from Cuba, Nicaragua, and Haiti to legally enter the country by air each month. A similar program was announced for Venezuelans late last year.<\\/p><p>An additional 600 migrants were approved to travel to the U.S. as of last Friday, according to CBS.<\\/p><p><strong>NYC Mayor Calls on Federal Support for Migrant Busing Crisis<\\/strong><\\/p><p>This week New York City Mayor Eric Adams <a href=\\\"https:\\/\\/www.cbsnews.com\\/news\\/eric-adams-nyc-mayor-el-paso-texas-border-federal-help-migrant-arrivals\\/\\\">visited El Paso,Texas<\\/a> to address the worsening border crisis and call on the federal government to provide more funding and operational support to cities tasked with welcoming an unprecedented influx of asylum seekers.<\\/p><p>Adams issued an emergency declaration back in October 2022 about his city\\u2019s capacity to take in additional migrants, having received tens of thousands in recent months \\u2014 many of whom were bused from the U.S.-Mexico border as part of Texas Governor Greg Abbott\\u2019s pushback against the Biden administration\\u2019s border policies. The Republican-led migrant relocations have worsened the housing and homelessness crises in New York City, with homeless shelter numbers reaching an all time high last year.<\\/p><p><strong>Immigrants Drive Innovation in the U.S., Finds News Report<\\/strong><\\/p><p>A <a href=\\\"https:\\/\\/www.boundless.com\\/blog\\/immigrant-innovation-study\\/?utm_source=autopilot&amp;utm_medium=email&amp;utm_campaign=012023_weekly\\\">new study<\\/a> found that immigrants drive 36% of innovation in the U.S., outperforming their U.S.-born counterparts when it comes to economic and technological inventions.<\\/p><p>Between 1990 and 2016, immigrants had applied for more than 25% of all patents issued. These patents were also likely to be worth more financially and be cited in their respective fields.<\\/p><h2>Have legal immigration questions? Get them answered by independent attorneys in our network for just $49.<\\/h2><p><a href=\\\"https:\\/\\/www.boundless.com\\/ask-my-attorney\\/\\\">GO TO BOUNDLESS\\u2019 ASK MY ATTORNEY PROGRAM<\\/a><\\/p>\",\"status\":\"1\",\"photo\":\"american_flag-flags-america.png\",\"user_id\":1,\"created\":\"2023-01-21T22:05:25+05:30\",\"photo_dir\":\"24bd68c6-96ae-4efc-a453-229bf4c962a7\",\"id\":16}'),
