(924, '2023-01-21 16:58:30', 'Articles', '17', NULL, NULL, 'Articles', '17', 'info', 'create', '', '{\"title\":\"Immigrants Drive More Innovation than U.S. born Counterparts\",\"short_description\":\"A new economic study estimates that immigrants are responsible for around 36 of innovation in the United States, outshining their U.S. born counterparts when it comes to economic and technological advancements.\",\"description\":\"\",\"status\":\"1\",\"photo\":\"new01.jpg\",\"user_id\":1,\"created\":\"2023-01-21T22:28:27+05:30\",\"photo_dir\":\"4952630d-4a17-4589-8141-69129d6c9da5\",\"id\":17}'),
