(926, '2023-01-21 16:59:20', 'Articles', '17', NULL, NULL, 'Articles', '17', 'info', 'update', '', '{\"description\":\"<p>A <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">new economic study<\\/a> estimates that immigrants are responsible for around 36% of innovation in the United States, outshining their U.S.-born counterparts when it comes to economic and technological advancements.<\\/p><p>In the groundbreaking new study for the National Bureau of Economic Research (NBER), a group of economists was able to <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">quantify the contribution of immigrant workers to innovation<\\/a> in the U.S. by linking patent records to more than 230 million Social Security numbers. To determine which patents belonged to immigrants, researchers looked at birth dates to distinguish U.S.-born and foreign-born innovators. During the period between 1990 and 2016, immigrants accounted for <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">more than a quarter of all patents issued<\\/a>. These patents were also more likely to be cited in their respective fields and held more financial value than those by native-born innovators.<\\/p><p>Evidence found in the study suggests that high-skilled immigrants help their American colleagues further develop innovations and increase productivity with the knowledge and fresh perspectives they bring from their home countries.<\\/p><p>&nbsp;<\\/p><p>The study also <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">cited<\\/a> that immigrants are vital to the dissemination of new ideas across borders, as \\u201cimmigrant inventors are more likely to rely on foreign technologies, to collaborate with foreign inventors, and to be cited in foreign markets.\\u201d High-skilled immigrant workers spark advancements in essential U.S. industries \\u2014 today, immigrants account for <a href=\\\"https:\\/\\/www.npr.org\\/sections\\/money\\/2023\\/01\\/10\\/1147391639\\/new-nation-new-ideas-a-study-finds-immigrants-out-innovate-native-born-americans\\\">a quarter of the STEM<\\/a> (science, technology, engineering, and mathematics) industry in the U.S., and more than <a href=\\\"https:\\/\\/research.newamericaneconomy.org\\/report\\/covid-19-immigrant-healthcare-workers\\/\\\">16% of the U.S. healthcare industry<\\/a>.<\\/p><p>Boundless\\u2019 <a href=\\\"https:\\/\\/www.boundless.com\\/research\\/immigrants-and-entrepreneurship\\/\\\">research report<\\/a> on immigration and entrepreneurship also found that immigrants not only innovate more, but are more likely to start new businesses and create jobs. According to data from the New American Economy organization, immigrants are more likely to start a new business than the native-born population, with one in four entrepreneurs in the U.S. now being an immigrant. As new business formation slows in the U.S., immigrant business owners are vital to driving a healthy economy and advancing the labor force across key sectors.<\\/p><p>These recent studies serve as a reminder that immigrants have long played a key role in the country\\u2019s social and economic makeup, particularly when it comes to innovation and advancements in the workforce.<\\/p><h2>&nbsp;<\\/h2>\"}'),
(927, '2023-01-21 16:59:20', '\\App', '1', NULL, NULL, 'Articles', '17', 'info', 'update', '', '{\"description\":\"<p>A <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">new economic study<\\/a> estimates that immigrants are responsible for around 36% of innovation in the United States, outshining their U.S.-born counterparts when it comes to economic and technological advancements.<\\/p><p>In the groundbreaking new study for the National Bureau of Economic Research (NBER), a group of economists was able to <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">quantify the contribution of immigrant workers to innovation<\\/a> in the U.S. by linking patent records to more than 230 million Social Security numbers. To determine which patents belonged to immigrants, researchers looked at birth dates to distinguish U.S.-born and foreign-born innovators. During the period between 1990 and 2016, immigrants accounted for <a href=\\\"https:\\/\\/www.nber.org\\/papers\\/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\\\">more than a quarter of all patents issued<\\/a>. These patents were also more likely to be cited in their respective fields and held more financial value than those by native-born innovators.<\\/p><p>Evidence found in the study suggests that high-skilled immigrants help their American colleagues further develop innovations and increase productivity with the knowledge and fresh perspectives they bring from their home countries.<\\/p><p>&nbsp;<\\/p><p>The study also <a href=\\\"https:\\/\\/www.nber.org\\/