 between people on a short term work visa who come for five years and work, and a residency pathway\\\" - Immigration Minister Michael Wood duration 4\\u2032\\u2009:14\\u2033 from Morning Report Add to playlist  Download\\r\\nDownload as Ogg\\r\\nDownload as MP3\\r\\nDownload as AAC\\r\\nPlay Ogg in browser\\r\\nPlay MP3 in browser\\r\\nPlay AAC in browser\\r\\n\\\"There\'s a clear differentiation between people on a short term work visa who come for five years and work, and a residency pathway\\\" - Immigration Minister Michael Wood\\r\\nTags: \\r\\nimmigration\\r\\nShare this \\r\\nShare on Twitter\\r\\nShare on Facebook\\r\\nShare via email\\r\\nShare on Reddit\\r\\nShare on Linked In\\r\\nCopyright \\u00a9 2023, Radio New Zealand\\r\\n\\r\\nSubscribe to RNZ\'s Daily Newsletter\\r\\n\\r\\n \\r\\nEmail address\\r\\nView latest newsletter\\r\\nNEXT STORY IN NEW ZEALAND\\r\\nCall for more streamlined approach, training for services involved in flood rescues\\r\\n\"}'),
