INSERT INTO `articles` (`id`, `title`, `short_description`, `description`, `photo`, `photo_dir`, `status`, `user_id`, `created`) VALUES
(1, 'UK and New Zealand expand working holiday visasX', '<p>The UK and New Zealand will allow more younger people to live and work in both countries for longerX.X</p>', '<blockquote><ol><li><strong>The UK and New Zealand will allow more younger people to live and work in both countries for longer.X</strong></li></ol><figure class=\"media\"><div data-oembed-url=\"https://www.youtube.com/watch?v=GjekUo84X2k\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/GjekUo84X2k\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure></blockquote><figure class=\"media\"><div data-oembed-url=\"https://www.youtube.com/watch?v=KMqi3k0cpy0\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/KMqi3k0cpy0\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure><p>UK Prime Minister Boris Johnson and his Kiwi counterpart Jacinda Ardern agreed to extend the Youth Mobility and Working Holiday schemes.</p><p>The age limit for applicants will go up from 30 to 35, and the maximum length of time people can stay in the host country will now be three years.</p><p>It follows similar deal to allow young people to <a href=\"https://www.bbc.com/news/business-59690080\">work and travel in Australia</a>.</p><p>&nbsp;</p><figure class=\"media\"><div data-oembed-url=\"https://www.youtube.com/watch?v=KMqi3k0cpy0\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/KMqi3k0cpy0\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure><p>The UK-New Zealand scheme was previously open to 18-30 year olds.</p><p>Home Secretary Priti Patel said the move \"will give even more young Brits and New Zealanders the opportunity to develop their skills, make life-long connections and contribute to their host country\".</p><figure class=\"image\"><img src=\"https://ichef.bbci.co.uk/news/640/cpsprodpb/11262/production/_125724207_hi077091937.jpg\" alt=\"Boris Johnson and Jacinda Ardern\" srcset=\"https://ichef.bbci.co.uk/news/240/cpsprodpb/11262/production/_125724207_hi077091937.jpg.webp 240w, https://ichef.bbci.co.uk/news/320/cpsprodpb/11262/production/_125724207_hi077091937.jpg.webp 320w, https://ichef.bbci.co.uk/news/480/cpsprodpb/11262/production/_125724207_hi077091937.jpg.webp 480w, https://ichef.bbci.co.uk/news/624/cpsprodpb/11262/production/_125724207_hi077091937.jpg.webp 624w, https://ichef.bbci.co.uk/news/800/cpsprodpb/11262/production/_125724207_hi077091937.jpg.webp 800w\" sizes=\"100vw\"></figure><p>IMAGE SOURCE,REUTERS</p><p>Image caption,</p><p>Boris Johnson and Jacinda Ardern met for talks at Downing Street</p><p>Ms Ardern, who is in London for talks with Mr Johnson, said New Zealand had long advocated for improvements to working holiday visas.</p><p>The NZ Labour Party leader previously lived in London when she worked in Whitehall as a senior policy adviser before entering politics.</p><p>\"I was one of many Kiwis to enjoy living and working in the UK, and we look forward to offering Brits the same wonderful experience in New Zealand,\" she added.</p><p>The prime ministers met at Downing Street following the Nato summit in Madrid which finished on Thursday.</p><p>Ms Ardern said the pair would be discussing the <a href=\"https://www.bbc.com/news/business-58988711\">free trade deal signed last year</a> as well as the response to the war in Ukraine</p><p>Mr Johnson praised the \"very strong line\" New Zealand was taking, and Ms Ardern said: \"We have also provided our military aid via our partnership with you,\"</p><p>The Home Office said more information on the <a href=\"https://www.gov.uk/youth-mobility\">Youth Mobility and Working Holiday</a> scheme will be announced next year.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'trend-digest-solo-travellers-GuestRevu.webp', 'a8464c47-342c-48b1-898c-0aa0d3ad5445', '0', NULL, '2022-08-04 11:38:23'),
(2, 'PM Jacinda Ardern says work underway to address nursing shortage, union remains unconvinced', '<p>Prime Minister Jacinda Ardern says the government is working to reduce the global nursing shortage\'s impact on the healthcare system.</p>', '<p>Prime Minister Jacinda Ardern. File photo Photo: RNZ / Angus Dreaver</p><p>Nearly one-in-three nursing students are dropping out before qualifying, due to financial pressure, family responsibilities and other factors made worse by Covid-19.</p><p>At the same time, health boards and rest homes are spending hundreds of thousands of dollars trying to attract nurses from overseas to fill an estimated 4000 vacancies.</p><p>But there are forces working the other way. The New South Wales government has unveiled a $4.5 billion package to recruit more than 10,000 staff - with New Zealanders sure to be in its sights.</p><p>Prime Minister Jacinda Ardern told <i>Morning Report </i>the government was aware of the global shortage of nurses and would be continuing campaigns to attract people to the industry from within the country and overseas.</p><p>\"I think it\'d be fair to say we\'ve been aware of the global shortage of nursing staff so we\'ve been running our own internal campaigns to try and attract our previous qualified nurses to come back,\" she said.</p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844873/government-aware-of-global-nursing-shortage-ardern\"><strong>\"We do hold a lot of vacancies because we\'ve also sought to create more nursing places\" - PM Jacinda Ardern duration7′ :38″</strong></a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport\">from Morning Report</a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844873/government-aware-of-global-nursing-shortage-ardern\"><strong>Add to playlist</strong></a></p><p>&nbsp;</p><p><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0709-ardern_on_nursing_workforce_pressure-128.mp3\">Download</a></p><ul><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0709-ardern_on_nursing_workforce_pressure-02.ogg\">Download as Ogg</a></li><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0709-ardern_on_nursing_workforce_pressure-128.mp3\">Download as MP3</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0709-ardern_on_nursing_workforce_pressure-02.ogg\">Play Ogg in browser</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0709-ardern_on_nursing_workforce_pressure-128.mp3\">Play MP3 in browser</a></li></ul><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844873/government-aware-of-global-nursing-shortage-ardern\">\"We do hold a lot of vacancies because we\'ve also sought to create more nursing places\" - PM Jacinda Ardern</a></p><p>To attract overseas nurses to the country, the government has given those in the profession the opportunity to gain residence after working in the field for two years.</p><p>Returning nurses are also being offered a one-off payment of $5000 to cover re-registration and other costs.</p><p>However, some nurses were upset the residence status had not been offered automatically upon arrival, Ardern said the inclusion of the two-year requirement was due to concerns around staff retention at some DHBs.</p><p>\"Essentially all it does is ask that you just work in the field for two years so it is recency we just ask that you stay as a nurse and one of the reasons for that is we did have raised with us by some DHBs the concern of whether of not we were retaining everyone that was coming in as a nurse.\"</p><p>Ardern was unable to provide the number of nurses that had returned to or arrived in the country as a result of the residency scheme, which was announced a month ago.</p><p>\"One of the things we also need to factor in is we have also increased the number of nursing staff so we do hold a lot of vacancies because we\'ve also sought to create more nursing places.</p><p>\"So this is one of struggles we have, we want to take some of the pressure off our hospitals by increasing those STEs at a time where everyone in recruiting,\" she said.</p><p>Ardern argued the data on nursing graduate dropouts did not reflect the current situation, but said the introduction of the fees free scheme had alleviated some of the financial pressures facing students.</p><p>Meanwhile, she said targeted nursing scholarships were on offer to boost Māori and Pasifika representation in the workforce.</p><figure class=\"image\"><img src=\"https://rnz-ressh.cloudinary.com/image/upload/s--o5Ge4I6w--/ar_16:10,c_fill,f_auto,g_auto,q_auto,w_1050/4MX92LC_image_crop_97219\" alt=\"Kerri Nuku, kaiwhakahaere for the Nurses Organisation\"></figure><p>Nurses Organisation director Kerri Nuku. File photo Photo: RNZ / Richard Tindiller</p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844877/nurses-organisation-concerned-shortage-will-get-worse\"><strong>\"At the moment I think nurses would fail to see what is actively being done\" - Nurses\' Organisation director Kerri Nuku duration6′ :33″</strong></a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport\">from Morning Report</a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844877/nurses-organisation-concerned-shortage-will-get-worse\"><strong>Add to playlist</strong></a></p><p>&nbsp;</p><p><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0735-nurses_organisation_concerned_shortage_will_get_worse-128.mp3\">Download</a></p><ul><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0735-nurses_organisation_concerned_shortage_will_get_worse-02.ogg\">Download as Ogg</a></li><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0735-nurses_organisation_concerned_shortage_will_get_worse-128.mp3\">Download as MP3</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0735-nurses_organisation_concerned_shortage_will_get_worse-02.ogg\">Play Ogg in browser</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0735-nurses_organisation_concerned_shortage_will_get_worse-128.mp3\">Play MP3 in browser</a></li></ul><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844877/nurses-organisation-concerned-shortage-will-get-worse\">\"At the moment I think nurses would fail to see what is actively being done\" - Nurses\' Organisation director Kerri Nuku</a></p><p>Nurses\' Organisation director Kerri Nuku told <i>Morning Report</i> nurses did not feel enough was being done to bolster their workforce.</p><p>\"At the moment I think nurses would fail to see what is actively being done and this isn\'t just about recruiting from overseas this is about supporting the development of our own nurses inside Aotearoa.\"</p><p>Nuku said the educational pipeline for nurses had been blocked by the pandemic, with financial pressures leading some students to postpone their studies and level four lockdowns blocking students from undertaking practical training within hospitals.</p><p>To prevent the number of students dropping out, DHBs needed to increase learning pathways and access to pastoral care, Nuku said.</p><p>However, she said the best step the government could take would be to reduce student nurses\' tertiary fees.</p><p>\"When a nursing student graduates they have around about a $30,000-to-$40,000 debt... now that\'s fine if they go to work in a district health board where they\'ve got the opportunity to walk alongside senior nurses and pay that off.</p><p>\"But if you go out into a primary healthcare sector or some of our other areas where they\'re not getting paid the same rates as district health boards then you\'re actually training nurses to work in some of our poorest areas and that\'s not okay.\"</p><p>Nuku said the Nurses\' Organisation would push against the use of employment bonding as they believed that increasing support for the profession would encourage graduates to stay in the country.</p><p>The College of Midwives also called for the government to invest in staff training and recruitment.</p><p>The four-year midwifery degree was expensive and the college <a href=\"https://www.rnz.co.nz/news/national/468623/burned-out-or-leaving-for-overseas-midwifery-sector-in-downward-spiral-says-union\">would like more financial support to retain students</a>, chief executive Alison Eddy said.</p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844887/student-nurse-on-pressure-on-the-workforce\"><strong>\'We need support as well\' - Third-year nursing student Jade Power duration4′ :14″</strong></a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport\">from Morning Report</a></p><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844887/student-nurse-on-pressure-on-the-workforce\"><strong>Add to playlist</strong></a></p><p>&nbsp;</p><p><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0815-student_nurse_on_pressure_on_the_workforce-128.mp3\">Download</a></p><ul><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0815-student_nurse_on_pressure_on_the_workforce-02.ogg\">Download as Ogg</a></li><li><a href=\"https://podcast.radionz.co.nz/downloads/mnr/mnr-20220607-0815-student_nurse_on_pressure_on_the_workforce-128.mp3\">Download as MP3</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0815-student_nurse_on_pressure_on_the_workforce-02.ogg\">Play Ogg in browser</a></li><li><a href=\"https://podcast.radionz.co.nz/mnr/mnr-20220607-0815-student_nurse_on_pressure_on_the_workforce-128.mp3\">Play MP3 in browser</a></li></ul><p><a href=\"https://www.rnz.co.nz/national/programmes/morningreport/audio/2018844887/student-nurse-on-pressure-on-the-workforce\">\'We need support as well\' - Third-year nursing student Jade Power</a></p><p>Third-year Otago Polytechnic nursing student Jade Power has been following the difficult situation from ground zero.</p><p>Power, who also chairs the national student unit of the Nurses Organisation, told <i>Morning Report </i>the pressure of the Covid-19 pandemic had forced many students to make tough decisions.</p><p>\"With level four lockdowns, most of us couldn\'t attend placements and get our hours required to sit Nursing Council state final so you had a lot of people deciding if they could continue on due to financial pressure with Covid not being able to work, only being able to study.\"</p><p>She said this had particularly affected those nursing students with children or other dependents.</p><p>The solution was a simple one, Power said, pay nurses for their placement training.</p><p>\"That\'s a very easy answer, getting paid for placements or having fees free for our education because we work 40 hour weeks for placement, for free essentially, and then we have to work part time to live.\"</p><p>Power said plenty of students were already eyeing up moves to the likes of Australia where they would be paid a more competitive rate.</p><p>However, she was aiming to stay in New Zealand and said more needed to be done to encourage others to do the same.</p><p>\"We need support as well, we want to keep our New Zealand nurses here and we need to do that by paying them better and creating better and safer work environments.\"</p>', '02.jpg', '56677d9a-ed66-447b-855b-2335946acc1d', '1', NULL, '2022-08-04 11:41:15'),
(3, 'Border inspector slams UK\'s handling of migrants arriving by boat', '<p>LONDON, July 21 (Reuters) - An independent border inspection has slammed Britain\'s handling of migrants who arrive by small boats from France, calling it unacceptable, ineffective and inefficient.</p>', '<p>LONDON, July 21 (Reuters) - An independent border inspection has slammed Britain\'s handling of migrants who arrive by small boats from France, calling it unacceptable, ineffective and inefficient.</p><p>The number of people attempting the dangerous crossing over the Channel to enter Britain has risen sharply. The government is facing criticism from some quarters that border controls are too weak, while others say people seeking asylum are being treated inhumanely.</p><p>Advertisement · Scroll to continue</p><p>&nbsp;</p><p>The inspection, led by Chief Inspector of Borders and Immigration David Neal and published on Thursday, focused on the initial processing of migrants at two government centres between December 2021 and January 2022.</p><p>\"These migrants crossed the Channel in dire circumstances. Many were vulnerable and at risk, including children and women on their own, and when they arrived in Dover the way they were dealt with was unacceptable,\" Neal said.</p><p>Advertisement · Scroll to continue</p><p>&nbsp;</p><p>\"This is because the Home Office has failed over the past three years to move from a crisis response to having better systems and procedures in place and treating this as business as usual.\"</p><p>A Home Office spokesperson said that the department had accepted the report\'s recommendations. The spokesperson said almost all the related work had already been completed, including the closure of one of the sites and the opening of a new facility.</p><p>Advertisement · Scroll to continue</p><p>&nbsp;</p><p>\"We have transformed how we manage the arrival of migrants,\" the spokesperson said.</p><p>In November 2021, 27 people died while attempting to cross the Channel in an inflatable dinghy - the worst recorded accident of its kind in the Channel - triggering a blame game between Britain and France.</p><p>London has announced a new immigration policy to send migrants to Rwanda for processing, but that has run into legal challenges.</p><p>The report said the government response to the surge in migrant arrivals at Dover on the southern English coast had exposed gaps in security procedures and left vulnerable migrants at risk, the report said.</p><p>The number of people arriving by small boats rose to 28,526 last year, compared with 8,486 in 2020 and 1,834 in 2019. Many of the migrants were from Iran and Iraq.</p><p>Neal also criticised record keeping as \"inexcusably awful\".</p>', '03.jpg', 'c0597e8b-1c9d-4b53-9e9e-817bed3f703d', '1', NULL, '2022-08-04 11:42:02'),
(4, 'Canada will reopen all PR programs under Express Entry from July 6', '<p>Canada will be lifting the last pandemic-era restriction on its immigration services. The country announced that all Express Entry draws will resume starting July 6.</p><p>&nbsp;</p>', '<p>Canada will be lifting the last pandemic-era restriction on its immigration services. The country announced that all Express Entry draws will resume starting July 6.</p><p>Canada first imposed restrictions at the start of the pandemic- over 18 months ago.</p><p>Think you check all the immigration boxes? Find out<br><br>Immigration minister Sean Fraser took to Twitter to invite all eligible candidates to apply under</p><p>This comes as a time when the country is already struggling to cope with massive processing delays. According to data shared with ET, Immigration, Refugees and Citizenship Canada (IRCC) had an immigration backlog of almost 2.4 million people, as of June 6, 2022.<br><br>Last month, Canadian Prime Minister Justin Trudeau also announced a new task force to tackle the delays, saying, “we know service delays, particularly in recent months, are unacceptable...we will continue to do everything we ca&nbsp;..<br>&nbsp;</p>', '04.jpg', 'a016cc48-8368-438d-9b21-7febc2df88b7', '1', NULL, '2022-08-04 11:44:43'),
(13, 'Dire new figures reveal extent of staffing shortage across NZ\'s EDs', 'Dire new figures reveal extent of staffing shortage across NZ\'s EDs', '<figure class=\"media\"><div data-oembed-url=\"https://youtu.be/dhHQ6eIETFs\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/dhHQ6eIETFs\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure>', 'Screenshot 2023-03-26 145401.jpg', '9bb623e0-7299-4eb4-88db-3b1648b0c214', '1', 1, '2023-01-21 21:36:00'),
(14, 'Changes to partner work visas deferred to April 2023', 'The Minister of Immigration announced today that planned changes for the visa requirements of partners of temporary work visa holders have been deferred to April 2023.', '<p>These changes were initially set to come into effect in December 2022.</p><p>The Government recognises that there is a need to ensure partners are only entering higher skilled jobs. However, they want to provide certainty for migrant partners of their ability to work in New Zealand and a streamlined process for entering high skilled roles.</p><p>The Government will be looking at some adjustments to the way partner work rights will be implemented to reflect some of the feedback received from stakeholders.</p><p>More information on this will be announced in the New Year.</p><p>More information is available on the Beehive website.</p><p><a href=\"https://www.beehive.govt.nz/release/changes-partner-work-visas-deferred-april-2023\">Changes to partner work visas deferred to April 2023 — Beehive</a></p>', 'changes-to-partner-work-visa-deferred-to-april-2023.jpg', '5156e837-a2b0-4e3c-9d90-eb6672aa3f3d', '1', 1, '2023-01-21 21:50:26'),
(15, 'Pacific Access Category and Samoan Quota draw to take place on Wednesday 7 December 2022', 'The draw to see who will be invited to apply for New Zealand residence under the Pacific Access Category (PAC) and the Samoan Quota (SQ) is happening on Wednesday 7 December.', '<p>Following the ballots closing for the Pacific Access Category (PAC) and the Samoan Quota (SQ), Immigration New Zealand (INZ) will draw the names of successful applicants on Wednesday 7 December who will be invited to apply for residence under these categories.</p><p>When the categories reopened, the Government agreed to allocate the unused places from the 2020 and 2021 ballots. For the Pacific Access Category, they will be re-allocated across the 2022 and 2023. The unused ballots under the Samoan Quota will be distributed across four years from 2022-2025.</p><p>This means that 1,300 individuals will be invited to apply for residence under the PAC for the 2022 ballot, and 1,650 individuals will be invited to apply for residence under the SQ for the 2022 ballot.</p><p>Successful registrant reference numbers will be published on the INZ website by 12 December, and then formally sent their invitation to apply letter later this month.</p><p>More information:</p><p><a href=\"https://www.immigration.govt.nz/new-zealand-visas/apply-for-a-visa/about-visa/samoan-quota-scheme-resident-visa\">Samoan Quota</a></p><p><a href=\"https://www.immigration.govt.nz/new-zealand-visas/apply-for-a-visa/visa-factsheet/pacific-access-category-resident-visa\">Pacific Access Category</a></p>', 'download (3).jfif', '49301480-5ae2-482b-aad0-33d2f11f16be', '1', 1, '2023-01-21 22:00:12'),
(16, 'Boundless Immigration News Weekly Recap: January 19, 2023', 'Undocumented workers will now be able to report labor violations without jeopardizing their immigration status. The Biden administration announced a new process that will allow immigrants who are exploited in the workplace, or who witness labor abuses, to apply for protections from deportation and retaliation from their employer.', '<p><strong>New Policy Protects Exploited Immigrant Workers from Deportation</strong></p><p>Undocumented workers will now be able to report labor violations without jeopardizing their immigration status. The Biden administration<a href=\"https://www.cbsnews.com/news/biden-administration-creates-deportation-protection-process-exploited-migrant-workers/\"> announced</a> a new process that will allow immigrants who are exploited in the workplace, or who witness labor abuses, to apply for protections from deportation and retaliation from their employer.</p><p>To qualify for deferred action, immigrant workers must submit a written request to USCIS and include a letter from an employment or labor agency supporting the request.</p><p><strong>First Group of Migrants Arrive in U.S. Under New Biden Program</strong></p><p>The first group of migrants has arrived in the U.S. <a href=\"https://www.boundless.com/blog/biden-announce-legal-status-migrants-title-42-expansion/?utm_source=autopilot&amp;utm_medium=email&amp;utm_campaign=012023_weekly\">under a new program</a> announced earlier this month by the Biden administration to address the crisis at the southern border.</p><p>According to <a href=\"https://www.cbsnews.com/news/migrants-us-sponsorship-program-biden-administration/\">CBS News</a>, ten migrants have entered the United States as part of the program, which will allow up to 30,000 people from Cuba, Nicaragua, and Haiti to legally enter the country by air each month. A similar program was announced for Venezuelans late last year.</p><p>An additional 600 migrants were approved to travel to the U.S. as of last Friday, according to CBS.</p><p><strong>NYC Mayor Calls on Federal Support for Migrant Busing Crisis</strong></p><p>This week New York City Mayor Eric Adams <a href=\"https://www.cbsnews.com/news/eric-adams-nyc-mayor-el-paso-texas-border-federal-help-migrant-arrivals/\">visited El Paso,Texas</a> to address the worsening border crisis and call on the federal government to provide more funding and operational support to cities tasked with welcoming an unprecedented influx of asylum seekers.</p><p>Adams issued an emergency declaration back in October 2022 about his city’s capacity to take in additional migrants, having received tens of thousands in recent months — many of whom were bused from the U.S.-Mexico border as part of Texas Governor Greg Abbott’s pushback against the Biden administration’s border policies. The Republican-led migrant relocations have worsened the housing and homelessness crises in New York City, with homeless shelter numbers reaching an all time high last year.</p><p><strong>Immigrants Drive Innovation in the U.S., Finds News Report</strong></p><p>A <a href=\"https://www.boundless.com/blog/immigrant-innovation-study/?utm_source=autopilot&amp;utm_medium=email&amp;utm_campaign=012023_weekly\">new study</a> found that immigrants drive 36% of innovation in the U.S., outperforming their U.S.-born counterparts when it comes to economic and technological inventions.</p><p>Between 1990 and 2016, immigrants had applied for more than 25% of all patents issued. These patents were also likely to be worth more financially and be cited in their respective fields.</p><h2>Have legal immigration questions? Get them answered by independent attorneys in our network for just $49.</h2><p><a href=\"https://www.boundless.com/ask-my-attorney/\">GO TO BOUNDLESS’ ASK MY ATTORNEY PROGRAM</a></p>', 'download (4).jfif', '24bd68c6-96ae-4efc-a453-229bf4c962a7', '1', 1, '2023-01-21 22:05:25'),
(17, 'Immigrants Drive More Innovation than U.S. born Counterparts', 'A new economic study estimates that immigrants are responsible for around 36 of innovation in the United States, outshining their U.S. born counterparts when it comes to economic and technological advancements.', '<p>A <a href=\"https://www.nber.org/papers/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\">new economic study</a> estimates that immigrants are responsible for around 36% of innovation in the United States, outshining their U.S.-born counterparts when it comes to economic and technological advancements.</p><p>In the groundbreaking new study for the National Bureau of Economic Research (NBER), a group of economists was able to <a href=\"https://www.nber.org/papers/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\">quantify the contribution of immigrant workers to innovation</a> in the U.S. by linking patent records to more than 230 million Social Security numbers. To determine which patents belonged to immigrants, researchers looked at birth dates to distinguish U.S.-born and foreign-born innovators. During the period between 1990 and 2016, immigrants accounted for <a href=\"https://www.nber.org/papers/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\">more than a quarter of all patents issued</a>. These patents were also more likely to be cited in their respective fields and held more financial value than those by native-born innovators.</p><p>Evidence found in the study suggests that high-skilled immigrants help their American colleagues further develop innovations and increase productivity with the knowledge and fresh perspectives they bring from their home countries.</p><p>&nbsp;</p><p>The study also <a href=\"https://www.nber.org/papers/w30797?utm_source=npr_newsletter&amp;utm_medium=email&amp;utm_content=20230106&amp;utm_term=7786824&amp;utm_campaign=money&amp;utm_id=10753161&amp;orgid=554&amp;utm_att1=\">cited</a> that immigrants are vital to the dissemination of new ideas across borders, as “immigrant inventors are more likely to rely on foreign technologies, to collaborate with foreign inventors, and to be cited in foreign markets.” High-skilled immigrant workers spark advancements in essential U.S. industries — today, immigrants account for <a href=\"https://www.npr.org/sections/money/2023/01/10/1147391639/new-nation-new-ideas-a-study-finds-immigrants-out-innovate-native-born-americans\">a quarter of the STEM</a> (science, technology, engineering, and mathematics) industry in the U.S., and more than <a href=\"https://research.newamericaneconomy.org/report/covid-19-immigrant-healthcare-workers/\">16% of the U.S. healthcare industry</a>.</p><p>Boundless’ <a href=\"https://www.boundless.com/research/immigrants-and-entrepreneurship/\">research report</a> on immigration and entrepreneurship also found that immigrants not only innovate more, but are more likely to start new businesses and create jobs. According to data from the New American Economy organization, immigrants are more likely to start a new business than the native-born population, with one in four entrepreneurs in the U.S. now being an immigrant. As new business formation slows in the U.S., immigrant business owners are vital to driving a healthy economy and advancing the labor force across key sectors.</p><p>These recent studies serve as a reminder that immigrants have long played a key role in the country’s social and economic makeup, particularly when it comes to innovation and advancements in the workforce.</p><h2>&nbsp;</h2>', 'Mythbusters-Report_TW.jpg', '4952630d-4a17-4589-8141-69129d6c9da5', '1', 1, '2023-01-21 22:28:27'),
(18, 'Japan Skilled Shortage List https://www.youtube.com/watch?v=DkwoCv2vTs0', '.', '<figure class=\"media\"><div data-oembed-url=\"https://www.youtube.com/watch?v=DkwoCv2vTs0\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/DkwoCv2vTs0\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure>', NULL, NULL, '0', 1, '2023-01-27 10:02:47'),
(20, 'メイン　入管法改正案　人権侵害を改める熟議こそ', '入管法改正案　人権侵害を改める熟議こそ　サブ', '<p>外国人の人権問題の改善という国内外の要請に応える内容になっていない。</p><p>　在留資格がない非正規滞在の外国人の収容・送還ルールを見直す入管難民法改正案が、衆院法務委員会で与野党４党の賛成で可決された。大型連休明けの衆院通過が見込まれている。</p><p>　改正案は、強制退去を命じられても本国送還を拒む人について、人権侵害が指摘されてきた入管施設での長期収容を解消するとうたう。だが、難民申請中の送還停止を原則２回に制限するなど、むしろ入管当局の権限を強化するものだ。</p><p>　迫害の恐れのある本国に送り返す懸念は拭えない。与野党の党利党略で拙速に進めれば、将来に禍根を残す。</p><p>　改正案は、収容者の死亡が相次いだため２０２１年に廃案となった旧案の骨格部分を維持。３回目の申請以降は「難民認定すべき相当の理由」を示さなければ送還するとした。</p><p>　一方、認定基準に満たなくても、難民に準じて在留を認める新制度や、一時的に社会で生活できるようにする「監理措置」の創設も盛り込んだ。収容中も３カ月ごとに必要性を見直すとし、「原則収容主義」への批判をかわす狙いといえる。</p><p>　だが、収容期間の上限は設けず、新たな措置も入管当局の判断次第だ。外国人支援団体や法学者らが、そもそも日本の難民認定率が欧米に比べ極めて低いという根本的な問題を挙げ、送還で生命の危険を招くと批判するのはもっともだろう。</p><p>　日本も批准する難民条約は、迫害を受ける恐れがある国への送還を禁じている。国連人権理事会の特別報告者は先月、改正案が国際基準を満たしていないとして「徹底的な見直し」を日本政府に求める公開書簡を送った。真摯（しんし）に受け止めるべきだ。</p><p>　衆院の与野党協議で、日本維新の会は認定担当者の研修など小幅な修正と引き換えに、国民民主党とともに賛成に回った。だが、入管の処遇内容には踏み込まず、形ばかりの「成果」を優先させた感が否めない。</p><p>　立憲民主党は第三者機関設置による難民審査を求め、与党は付則に「検討」と盛り込む案を示した。だが、抜本的な見直しの実現が不透明だと立民は反対し、白紙に戻された。</p><p>　与党側は立民との交渉で、日本で育ちながら在留資格のない外国人の子どもへの「在留特別許可」付与の検討も持ち出した。これを「人質」にして法案を通そうというのか、理解に苦しむ。</p><p>　収容中だったスリランカ人女性死亡の真相も解明されぬまま、外国人労働者の受け入れ拡大の議論も進んでいる。</p><p>　保護すべき人をいかに守り、救済するのか。参院の審議を通じて根本からの議論を尽くさねば、先進７カ国首脳会議（Ｇ７広島サミット）でも日本の人権意識が疑われよう。</p><p>&nbsp;</p><p><a href=\"https://www.kyoto-np.co.jp/articles/-/1018334\">https://www.kyoto-np.co.jp/articles/-/1018334</a></p>', NULL, NULL, '1', 1, '2023-05-03 14:02:05'),
(21, 'Golden Visas: Long-Term Residency in the UAE', 'Golden Visas: Long-Term Residency in the UAE', '<p>The year 2023 has been labelled as the year of resilience, with a focus on immigration policies to alleviate the pressure on global economies caused by the shortage of skilled labour.<br><br>Concerns about the national security and political stability of the countries to which tourists are considering travelling have joined health and safety concerns as major factors in determining which destinations are chosen, even as the effects of Ukraine’s conflict continue to dominate global headlines.<br><br>One of the most notable migration trends, however, has been the gradual increase in migration channels designed specifically to accommodate highly skilled individuals.<br><br><strong>Spotlight on the UAE</strong><br><br>In this current environment, the United Arab Emirates remains competitive thanks to its ability to attract top talent from around the world and its high levels of investment and innovation, both of which create new job opportunities.<br><br>“What you do” and “where you do it” are no longer inextricably linked in the post-COVID-19 era. The UAE has one of the most diverse populations in the world, with residents from more than 200 countries. This means that multinational corporations can tap into&nbsp;a diverse pool of talent, ranging from technology specialists to highly qualified service professionals. This will be necessary given the IMF’s recent prediction that there will be a global shortage of more than 85 million tech workers by 2030, representing AED 31.2 trillion in lost annual revenue.<br><br>As the UAE boasts one of the world’s most digitally advanced economies, the government will tap into the global shortage of tech workers by embracing innovation and enabling an ecosystem with a variety of futuristic long-term strategies across AI, blockchain, 3D printing and Internet of Things (IoT).</p><p>Moreover, the UAE has a variety of different visa options, including those for remote workers, freelancers and even the highly sought-after “golden visas,’’ which attract highly skilled professionals from all over the world.<br><br><strong>The UAE’s Long-Term Residence Permits</strong><br><br>Although the concept of long-term residency in the UAE is still relatively new compared to many other global residence programs, the UAE Golden Visa has gained significant momentum throughout the past few years.<br><br>During the last twelve months, we have seen the UAE’s Golden Visa emerge as one of the most coveted visa options when securing long-term residence in the Middle East. More than 152,000 UAE Golden Visas have been issued since the launch of the Golden Visa Program in 2019, giving way to a major shift in policy towards more welcoming legislation to fill open positions, attract visitors and secure long-term talent across the UAE.<br><br>The UAE has made great strides in making its Golden Visa offering very competitive by including the following benefits:</p><ul><li>Long-term, renewable residency valid for 10 years.</li><li>No minimum requirement for the number of days of residency, giving frequent travellers the flexibility to spend extended periods of time out of the UAE without jeopardising their residency status.</li><li>Residency not being tied to a specific employer.</li><li>The ability to sponsor legal dependents, including a spouse, parents and dependent children, regardless of their ages.</li><li>The ability to sponsor a residence permit for an unlimited number of domestic workers.</li><li>Golden Visa holders having potential eligibility for discounts on cars, real estate, health care, health insurance, banking services, dining, spa treatments, gyms, and stays at selected hospitality destinations throughout the UAE.</li><li>In the unfortunate event that the primary holder of the Golden Visa passes away, legal dependents being allowed to stay in the UAE until the end of their permit duration.</li></ul><p><strong>Looking Ahead</strong></p><p>Long-term residency programmes in the UAE have made it possible not only for highly skilled professionals and specialists, but also for real estate investors, entrepreneurs, students and retirees to relocate to a more favourable jurisdiction and obtain full residency rights.<br><br>These rights include the right to live, work, study and receive healthcare in the country. It is becoming increasingly clear that the current surge in Golden Visa applications will continue as long as the government remains creative in offering expanded and accessible long-term visa categories.<br><br>Are you interested in obtaining long-term residency for the UAE? To determine whether you are eligible to apply, use Fragomen’s FREE <a href=\"https://www.fragomen.com/landing-page/are-you-eligible-for-a-uae-residence-visa.html\">Long-Term Residence Assessment Eligibility Tool</a>.<br><br><strong>Need to know more?</strong><br><br>For further information on long-term residency requirements, please contact Senior Private Client Manager Nofisatu Mojidi at <a href=\"mailto:nmojidi@fragomen.com\">nmojidi@fragomen.com</a>.<br><br>This blog was published on 2 May 2023, and due to the circumstances, there are frequent changes. To keep up to date with all the latest updates on global immigration, please visit our <a href=\"https://www.fragomen.com/about/news/immigration-update-coronavirus\">dedicated COVID-19 site</a>, subscribe to our&nbsp;<a href=\"https://www.fragomen.com/insights/alerts/subscribe/\">alerts</a>&nbsp;and follow us on&nbsp;<a href=\"https://www.linkedin.com/company/fragomen-del-rey-bernsen-&amp;-loewy/mycompany/?viewAsMember=true\">LinkedIn</a>,&nbsp;<a href=\"https://twitter.com/fragomen\">Twitter</a>,&nbsp;<a href=\"https://www.facebook.com/FragomenWorldwide\">Facebook</a>&nbsp;and&nbsp;<a href=\"https://www.instagram.com/fragomenimmigration/\">Instagram</a>.</p>', 'golden-visas-long-term-residency-in-the-uae-header-1.png', '0316a7da-e14d-4658-bca9-b66bce0f31e7', '1', 1, '2023-05-03 14:04:38'),
(22, '最近の入管法改正', '入管法及び法務省設置法改正について', '<p>平成３０年１２月８日，第１９７回国会（臨時会）において「出入国管理及び難民認定法及び法務省設置法の一部を改正する法律」が成立し，同月１４日に公布されました（平成３０年法律第１０２号）。</p><p>この改正法は，在留資格「特定技能１号」「特定技能２号」の創設，出入国在留管理庁の設置等を内容とするものです。</p>', NULL, NULL, '1', 1, '2023-05-03 14:11:18'),
(23, 'Changes to New Zealand skilled migrant category. ', 'Today (21st June 2023) the Minister of Immigration announced the new settings for the Skilled Migrant Category Resident Visa as well as a change to the Accredited Employer Work Visa (AEWV) settings. These are being updated to help support Aotearoa New Zealand’s economic growth and to provide more certainty to migrants and employers.', 'https://www.rnz.co.nz/news/national/492353/changes-to-skilled-migrant-visa-will-offer-more-certainty-for-applicants-govt-says', NULL, NULL, '1', 1, '2023-06-23 05:27:36'),
