INSERT INTO `helps` (`id`, `title`, `description`, `status`, `created`) VALUES
(3, 'How to choose the best  for immigration', '<p>The migration policy of many countries does not allow foreigners to obtain permanent residence without a temporary one. The exception is a few states that offer to get permanent residency by investment and skip the stage of temporary residence.&nbsp;</p><p>The article discusses opportunities for immigration in different countries, and where it is cheaper to live and easier to settle.</p>', '1', '2022-09-25 13:11:37'),
(2, 'I wish to follow AAT. What should I do first?', '<p>Registering with AAT is the first compulsory step anybody who wishes to follow AAT should do. Only the registered students can apply for AAT examinations / exemptions, receive correspondence from AAT and get eligible for any benefits announced by AAT. Initial registration is valid for one calendar year in which you register (until 30th of December of the given year ) regardless of the date of registration and is required to be renewed annually until you complete all AAT examinations and become a Passed Finalist (PF) . Once you become a PF, you will be awarded with the certificate named “Diploma in Accounting and Business”.</p><p>If you have registered for the July Examination, with your initial registration, you will be eligible to apply for both July and next year January examinations.</p><p>You are not required to register annually as this is a one-time process. Renewal of the registration will be required annually.</p>', '1', '2022-09-25 12:52:37');
