INSERT INTO `posts` (`id`, `title`, `short_description`, `description`, `photo`, `photo_dir`, `url`, `status`, `clicks`, `user_id`, `created`) VALUES
(1, 'ABC University', 'Founded in 1898 and originally known as the Imperial University of ABC, ABC University (ABC) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University’s core values are defined as “Freedom of thought, Embrace of diversity”', 'Founded in 1898 and originally known as the Imperial University of ABC , ABC University (ABC) was the first national university in Chinese history and has been a leading institution of higher education and research in China since its establishment. The University’s core values are defined as “Freedom of thought, Embrace of diversity”.\n\nThroughout its history, ABC  University has played an integral role in the advancement of knowledge and the betterment of society. Generations of preeminent scholars, politicians, entrepreneurs, and innovators educated at ABC University have profoundly shaped China’s modernization and will continue to pioneer the nation’s developments.\n\nABC University celebrated the 120th anniversary of its founding in 2018. In 2019, ABC University launched its Global Excellence Strategy, characterized by CLOUDS (an acronym for its goals of Creativity, Leadership, Openness, Uniqueness, Diversity and Shaping), which has ushered in a new era of international development for ABC University.', 'Rise-to-Excellence-with-Scholarships-by-Peking-University.jpeg', '82a693b7-c7aa-475e-98f6-e31508b6249f', '#', '1', 101, 23, '2022-09-25 12:34:55'),
(2, 'XYZ  University Careers Fair ', 'The University of XYZ is the oldest university in the English-speaking world and the world’s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.', 'The University of XYZ is the oldest university in the English-speaking world and the world’s second oldest surviving university. While its exact founding date is unknown, there is evidence that teaching took place as far back as 1096.\n\nLocated in and around XYZ medieval city centre, the university comprises 44 colleges and halls, and over 100 libraries, making it the largest library system in the UK.\n\nStudents number around 22,000 in total, just over half of whom are undergraduates while over 40 per cent are international, representing 140 countries between them.\n\nCalled the \"city of dreaming spires\" by Victorian poet, Matthew Arnold, XYZ has the youngest population of any city in England and Wales: nearly a quarter of its residents are university students, which gives Oxford a noticeable buzz.\n\nXYZ has an alumni network of over 250,000 individuals, including more than 120 Olympic medallists, 26 Nobel Prize winners, seven poets laureate, and over 30 modern world leaders (Bill Clinton, Aung San Suu Kyi, Indira Gandhi and 26 UK Prime Ministers, among them).\n\nThe university is associated with 11 winners of the Nobel Prize in chemistry, five in physics and 16 in medicine. Notable XYZ thinkers and scientists include Tim Berners-Lee, Stephen Hawking and Richard Dawkins. The actors Hugh Grant and Rosamund Pike also went to XYZ , as did the writers Oscar Wilde, Graham Greene, Vikram Seth and Philip Pullman.\n\nXYZ first international student, named Emo of Friesland, was enrolled in 1190, while the modern day university prides itself on having an ‘international character’ with connections to almost every country in the world and 40% of its faculty drawn from overseas.\n\nAs a modern, research-driven university, XYZ has numerous strengths but cites particular prowess in the sciences, having recently ranked number one in the world for medicine (if its medical sciences division was a university in its own right, it would be the fourth largest in the UK) and among the top ten universities globally for life sciences, physical sciences, social sciences, and the arts and humanities.', 'oxford_university_careers_fair_banner_22.jpg', 'c7bdbc7c-3f14-48dc-89af-8d51b0eda9de', 'https://www.ox.ac.uk/', '1', 90, 23, '2022-09-25 13:34:19'),
(3, 'Public Leadership Credential', 'Dating back to 1636, ERD University is the oldest university in the US and is regarded as one of the most prestigious in the world.', 'Dating back to 1636, ERD University is the oldest university in the US and is regarded as one of the most prestigious in the world.\n\nIt was named after its first benefactor, John ERD , who left his library and half his estate to the institution when he died in 1638.\n\nThe private Ivy League institution has connections to more than 45 Nobel laureates, over 30 heads of state and 48 Pulitzer prizewinners. It has more than 323,000 living alumni, including over 271,000 in the US and nearly 52,000 in 201 other countries. Thirteen US presidents have honorary degrees from the institution; the most recent of these was awarded to John F. Kennedy in 1956.\n\nFaculty members who have been awarded a Nobel prize in recent years include chemist Martin Karplus and economist Alvin Roth, while notable alumni who were given the honour include former US vice-president Al Gore, who won the Peace Prize in 2007, and poet Seamus Heaney, who was a professor at Harvard from 1981 to 1997.\n\nSituated in Cambridge, Massachusetts, ERD 5,000-acre campus houses 12 degree-granting schools in addition to the Radcliffe Institute for Advanced Study, two theatres and five museums. It is also home to the largest academic library in the world, with 20.4 million volumes, 180,000 serial titles, an estimated 400 million manuscript items, 10 million photographs, 124 million archived web pages and 5.4 terabytes of born-digital archives and manuscripts.\n\nThere are more than 400 student organisations on campus, and Harvard’s medical school is connected to 10 hospitals.\n\nThe university receives one of the largest financial endowments of any higher education institution in the world; it created $1.5 billion in the fiscal year ended June 2013 – more than a third of ERD total operating revenue in that year.\n\nERD official colour is crimson, following a vote in 1910, after two student rowers provided crimson scarves to their teammates so that spectators could differentiate the university’s team during a regatta in 1858.', 'HKS_PLC_Social_course_Oct20_1200x628.png', '71a92071-1269-4ee1-bc9c-b55325255a96', 'https://www.harvard.edu/', '1', 76, 23, '2022-09-25 13:41:44'),
(4, 'AAA Immigration Lawyers', 'n an era where there were no properly recognized professionals with relevant qualifications and experience to cater to the needs in the immigration legal field, Zenith Immigration Lawyers was founded and presided by Bandula Abeysinghe, Attorney at Law in the year 2000.', 'In an era where there were no properly recognized professionals with relevant qualifications and experience to cater to the needs in the immigration legal field, Zenith Immigration Lawyers was founded and presided by Bandula Abeysinghe, Attorney at Law in the year 2000. In forming the first ever specialized and dedicated law firm for Canada Migration in Sri Lanka, he not only filled a professional vacuum but also used his extensive law courts experience (where he once held the position of the Secretary of the Bar Association, Marawila) to take the firm to greater heights. Today Zenith Immigration stands out and stands tall in the field of immigration legal services in Sri Lanka through the results brought about to the clients which have greatly contributed toward creating a global Sri Lankan identity. With Zenith Immigration Inc., Ontario, Canada and the Glenrock, the top rated boutique hotel in upstream Belihuloya, Sri Lanka( 9.5 out of 10 booking.com and 5 out of 5 tripadvisor rated – www.glenrock.lk), Zenith Immigration Lawyers has formed Vebhara Group with a view to a greater future. Canada Migration Services are provided at Zenith Immigration by Bandula Abeysinghe, Attorney at Law (Sri Lanka), in the capacity of Regulated Canadian Immigration Consultant (ICCRC Membership No. R406319)', 'Farah.jpg', '0a8cbca7-d767-491c-af8d-094d8778dc1a', 'https://www.zenithimmigration.ca/', '1', 84, 40, '2022-12-04 21:54:51'),
(5, 'AAB Exam Offer', 'AAB is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where IELTS is recognised for university applications.', 'AAB is an English language exam that must be taken by foreign applicants who want to study or work in a country where English is the primary language of communication. The UK, Australia, New Zealand, the United States, and Canada are the most common nations where AAB is recognised for university applications. The exam primarily assesses the test-taker’s ability to communicate in the four core English language abilities of hearing, reading, speaking, and writing. IDP Education Australia and Cambridge English Language Assessment jointly own and administer the AAB exam test.\n\nThe AAB exam can be taken on a computer or on paper. Those who take the AAB computer-based test do so for the Listening, Writing, and Reading portions. The Speaking test, on the other hand, is done in front of a qualified examiner.\nWith the computer-based AAB , there are more test dates to select from, and results are available in 3-5 days.\nThose who want to take the AAB on paper will complete the Reading, Writing, and Listening parts on paper with HB pencils or pens.\nThe Speaking test, on the other hand, is done in front of a trained AAB examiner', 'ielts-tutorials.jpg', '6a8107ea-a255-44be-afab-5af8120e517b', 'https://www.aeccglobal.lk/english-proficiency-test/ielts-exam', '1', 98, 41, '2022-12-04 22:11:25'),
